contracts/FrensLogo.sol.content:
pragma solidity >=0.8.0 <0.9.0;
//SPDX-License-Identifier: MIT

contract FrensLogo {
  function getLogo() external pure returns (bytes memory){
    return(
      abi.encodePacked('<image  transform="matrix(.40,0,0,.40,0,0)"   xlink:href="data:image/png;base64,"/>')
    );
  }
}

